import Link from 'next/link';

const Navbar = () => (
   <div className="container">
       <> 
        <nav>
            
            <Link href="/">Home</Link>
            <Link href="/about"><a>About</a></Link>
            <Link href="/projects"> <a>Projects</a> </Link>
            <Link href="/contact"><a>Contact</a>  </Link>
            
        </nav></>
    </div>
)
export default Navbar;
